              }
            },
            (err) => {
              postMessage({ type, err });
            },
          );
          break;
        }
        case 'end-profiling':
          endProfiling(message!);
          postMessage({ type });
          break;
        default:
      }
    } catch (err) {
      postMessage({ type, err } as OrtWasmMessage);
